  [],\n\t\"revision_timestamp\": \"2016-07-27T23:02:05.820273\",\n\t\"name\": \"census-nesting-and-productivity-of-bald-eagles-in-southeast-alaska-1966\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"A study of the bald eagle (Haliaeetus leucocephalus)
  in southeast Alaska was conducted during the period March 15, 1966 to July 7, 1966.
  The first surveys were for the purpose of counting the total eagles present and
  to start the task of locating nests. The initial count of 803 birds was made and
  214 eagle nest locations were found and recorded. The study area of Admiralty Island
  and adjacent lands was segmented into 86 individual study plots comprised of 10
  miles of seacoast. From that total there was selected by random means 10 plots to
  be subjected to intense study. Data relative to nest types, nest construction, preference
  locations and eagle nesting in relation to human disturbance were recorded. An analysis
  that compared nest density to waterfront type proved that first choice nest sites
  were those fronting on the open seacoast.\",\n\t\"license_title\": \"License Not
